import axios from "axios";
import { ref } from "vue";

export default async function backend(url) {
  const apiUrl = 'http://localhost:8000/api/';
  const apiData = ref();

  const apiCall = () => {
    return fetch(apiUrl+"calendar/week")
      .then(res => res.json()).then(resJson => {
      return resJson;
    });
  }
  apiData.value = await apiCall();
  console.log(apiData.value);

  return {
    apiData
  }
}
